import React from 'react';
import {Navbar, Container} from 'react-bootstrap/Navbar';

function App() {
  return (
    <div>
      <Navbar sticky="top" >
        <Container fluid>
          <Navbar.Brand href="#">Navbar scroll</Navbar.Brand>
        </Container>
      </Navbar>
      <p>Hello</p>
    </div>
  );
}

export default App;
